webpackJsonp([0xb3e7f5b65b18],{450:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Phanor Coll - Fullstack Developer",author:"Phanor Coll"}}},pathContext:{posts:[{html:'<h2>A few weeks ago a I decided to try out elementaryOS, being a core fedora user, it was confusing at first, especially with the package manager, moving from dnf to apt-get / aptitude, I’m still getting the hang of it, for managing packages, etc.</h2>\n<p>Being a fullstack developer I’ve come to love <a href="http://docker.com/">docker</a>, so naturally it was one of the first things that I needed to install on elementaryOS, but I had some issues following the <a href="https://store.docker.com/editions/community/docker-ce-server-ubuntu">instructions at the Docker Store</a> and trying to apply them to elementaryOS, after doing some research I came to this solution, hopefully it’ll help others in my situation.</p>\n<p>Follow the initial instructions found here , but when you get to the part</p>\n<div class="gatsby-highlight" data-language="console">\n      <pre class="language-console"><code class="language-console">sudo add-apt-repository \\\n   &quot;deb [arch=amd64] https://download.docker.com/linux/ubuntu \\\n   $(lsb_release -cs) \\\n   stable&quot;</code></pre>\n      </div>\n<p>replace <strong>$(lsb_release -cs)</strong> with <strong>xenial</strong></p>\n<div class="gatsby-highlight" data-language="console">\n      <pre class="language-console"><code class="language-console">sudo add-apt-repository \\\n   &quot;deb [arch=amd64] https://download.docker.com/linux/ubuntu \\\n   xenial \\\n   stable&quot;</code></pre>\n      </div>\n<p>and continue following the documentation.</p>\n<p>PS. if you want to run docker without the SUDO command, follow these <a href="https://docs.docker.com/engine/installation/linux/linux-postinstall/">instructions</a></p>\n<p>Hope this helps.</p>',id:"/home/development/projects/reactjs/phanorcoll.com/gatsby-blog/src/pages/blog/2018-05-04-docker-compose/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2018-05-04",path:"/docker-elementaryos",title:"Docker and elementaryOs Loki",excerpt:"A few weeks ago a I decided to try out elementaryOS, being a core fedora user, it was confusing at first, especially with the package manager, moving from dnf to apt-get / aptitude, I’m still getting the hang of it, for managing packages, etc.",tags:["docker","containers","linux","elementaryOs"],featuredImage:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:1.4789156626506024,sizes:"(max-width: 491px) 100vw, 491px",src:"/static/docker-a0107b5b73947a86f0f7957067fdda2b-1c558.png",srcSet:"/static/docker-a0107b5b73947a86f0f7957067fdda2b-e7e2a.png 123w,\n/static/docker-a0107b5b73947a86f0f7957067fdda2b-fed6a.png 246w,\n/static/docker-a0107b5b73947a86f0f7957067fdda2b-1c558.png 491w"}}}}}],tagName:"docker"}}}});
